import React from "react"

class Comp extends React.Component{
    constructor(props){
    super(props);
    this.state ={
        mouseState:false
        };  

    this.mouseHandleDown = this.mouseHandleDown.bind(this);
    this.mouseHandleUp = this.mouseHandleUp.bind(this);
    }

    mouseHandleDown() {
        console.log("mouse over here");
        this.setState({mouseState:true});

    }
    mouseHandleUp()
    {
        this.setState({mouseState:false});
    }
    render()
    {
        console.log(this.state.mouseState);
        return(
            <div>
                <img alt="ok" 
                onMouseDown={this.mouseHandleDown} 
                onMouseUp={this.mouseHandleUp}
                src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__340.jpg"></img>
            </div>
        )
    }
}

export default Comp
